import { createSlice } from "@reduxjs/toolkit";

createSlice({
    name: 'tab',
    initialState: {
        isCollapse: false
    },
    reducers: {
        collapseMeun: state =>{
            state.isCollapse = !state.isCollapse
        }
    }

})

export const {collapseMeun} = tabSlice.actions
export default tabSlice
